import { useState } from 'react'

const Typography = (props) => {

    const { variant, sx, children } = props
    const [type, setType] = useState('')

    switch(variant) {
        case 'h1':
            setType('text-4xl font-bold')
            break;
        case 'h2':
            setType('text-2xl font-bold')
            break;
        case 'h3':
            setType('font-bold')
            break;
        case 'body':
            setType('')
            break;
        default:
            setType('')
            break;
    }

    return (
        <p className={type}>
            {children}
        </p>
    )
}

export default Typography
